import React from "react";
import "./Cart.scss";
import image1 from "../../assets/image1.jpeg";
import image2 from "../../assets/image2.jpeg";

const Cart = () => {
  return (
    <div className="cart">
      <div className="title">Your Cart</div>
      <div className="cart-items">
        <div className="item">
          <img src={image1} alt=""></img>
        </div>
        <div className="item"></div>
      </div>
    </div>
  );
};

export default Cart;
